-- Unit test for [sqids].[IdToInt].
-- The test passes when all rows have a 1 in the Is Match column.

DECLARE @alphabet AS [sqids].[IntCharTable]

DECLARE @tests TABLE (Number INT, Id NVARCHAR(MAX))

SELECT
	Number,
	Id,
	[Sqids].[IdToInt](Id, @alphabet) [Calculated Id],
	CASE WHEN Number = [Sqids].[IdToInt](Id, @alphabet) THEN 1 ELSE 0 END [Is Match]
FROM @tests